import { Grid, Row, Col } from 'react-bootstrap';
const ShopSingleContainer = (props) => {
    // console.log(props)
    return (
        <Grid>
            <Row className="show-grid">
                <Col xs={12} md={8}>
                    <code>{'<Col xs={12} md={8} />'};</code>
                </Col>
                <Col xs={6} md={4}>
                    <code>{'<Col xs={6} md={4} />'}</code>
                </Col>
            </Row>

        </Grid>
        // <div>
